INSERT INTO insurehub.product (product_id, product_name, description, admin_id, coverage_desc, rate_amount) VALUES ('5C8BD4E8-7ACF-E305-9957-577167FC953C', 'SafeGuard Health Plus', 'Comprehensive health insurance with extended coverage for critical illnesses and hospitalization benefits.', '0DAF5D9B-1B77-81AD-8E04-7998A58D9015', '{"This policy includes a specialized rider that covers a wide range of critical illnesses beyond the standard policy, providing additional financial protection in the event of serious health conditions such as cancer, stroke, heart attack, and more.","Offers complete coverage for hospital stays, including room charges, nursing expenses, intensive care unit costs, and medical practitioner fees, ensuring minimal out-of-pocket expenses during hospitalization.","Covers medical costs incurred before admission (pre-hospitalization) and after discharge (post-hospitalization), including diagnostics, medications, and follow-up visits.","Features a cashless treatment option in an extensive network of hospitals, allowing for a seamless and hassle-free experience during medical emergencies.","Ensures that there are no sub-limits on room rent, allowing policyholders to choose hospital rooms according to their comfort without worrying about additional charges."}', 1550.00);
INSERT INTO insurehub.product (product_id, product_name, description, admin_id, coverage_desc, rate_amount) VALUES ('342C7C04-B89D-419B-91F4-0231288C95B4', 'Family Wealth Protector', 'A life insurance product designed to build wealth for your family while offering protection', '69A6CDA3-41D3-B43C-5E10-6EBC4B444536', '{"This policy can serve as income replacement, providing your beneficiaries with the necessary funds to maintain their standard of living.","Use the policy as a tool for estate planning, helping your heirs manage any estate taxes or legal fees they may encounter.","Ensure that your childrens education expenses will be covered, giving them the opportunity to pursue their academic goals without financial hindrance.","Some policies may offer the option to convert your term life insurance to a whole life or universal life policy, providing lifelong coverage without the need for a medical exam.","Above all, this policy gives you peace of mind, knowing that your loved ones will be taken care of financially in case the worst happens."}', 2000.00);
INSERT INTO insurehub.product (product_id, product_name, description, admin_id, coverage_desc, rate_amount) VALUES ('3583F627-42F7-3D3E-6B1A-2A5083B5343A', 'SeniorCare Advantage', 'Tailored insurance cover for seniors, offering benefits like health care, hospitalization, and critical illness coverage', '351BE228-665D-7C1E-F635-241DC4678153', '{"This policy can serve as income replacement, providing your beneficiaries with the necessary funds to maintain their standard of living.","Use the policy as a tool for estate planning, helping your heirs manage any estate taxes or legal fees they may encounter.","Ensure that your childrens education expenses will be covered, giving them the opportunity to pursue their academic goals without financial hindrance.","Some policies may offer the option to convert your term life insurance to a whole life or universal life policy, providing lifelong coverage without the need for a medical exam.","Above all, this policy gives you peace of mind, knowing that your loved ones will be taken care of financially in case the worst happens."}', 2500.00);
INSERT INTO insurehub.product (product_id, product_name, description, admin_id, coverage_desc, rate_amount) VALUES ('11F01182-8A63-A37D-1CDE-5BB23E665AF9', 'HomeSafe Property Insurance', 'Property insurance offering complete protection against natural disasters, theft, and damage to your home', '3457D733-E929-4BB1-9B82-B07A06BE76F3', '{"The policy provides robust financial protection against a wide array of natural disasters, including earthquakes, floods, hurricanes, and wildfires, ensuring that homeowners can rebuild and recover without the burden of overwhelming costs.","Features coverage for losses due to theft or burglary, including damage to your property caused by a break-in and compensation for stolen valuables.","Ensures that any structural damage to your home, from the foundation to the roof, is covered, allowing for repairs or reconstruction as needed.","Extends protection to include personal belongings within the home, such as furniture, electronics, and clothing, with the option to appraise and insure high-value items separately.","Offers liability coverage that protects the homeowner against legal responsibility for any injuries or property damage to others caused by you or your family members, including pets."}', 800.00);
INSERT INTO insurehub.product (product_id, product_name, description, admin_id, coverage_desc, rate_amount) VALUES ('264F6C29-154D-C684-B227-BD5FC3337C53', 'AutoSecure Plus', 'Comprehensive car insurance with collision, theft, and liability coverage, plus roadside assistance', '0DAF5D9B-1B77-81AD-8E04-7998A58D9015', '{"Insures your vehicle against damage from accidents, including collisions with other vehicles or stationary objects, regardless of who is at fault.","Offers financial protection against the loss of your vehicle due to theft, as well as damage from attempted theft or break-ins.","Covers the costs associated with bodily injury and property damage suffered by others in an accident for which you are legally responsible.","Provides services such as towing, flat tire changes, jump-starts, lockout assistance, and fuel delivery if your car breaks down while on the road.","Protects against non-collision related damage to your car from incidents such as fire, vandalism, and natural disasters."}', 850.00);
INSERT INTO insurehub.product (product_id, product_name, description, admin_id, coverage_desc, rate_amount) VALUES ('5509D6FC-0CC1-E65A-BB75-012778595CA9', 'SecureLife Term Assurance', 'Affordable term life insurance providing financial security for your loved ones in the event of unexpected circumstances', '3457D733-E929-4BB1-9B82-B07A06BE76F3', '{"This term life insurance policy is designed to provide your beneficiaries with a substantial payout in the event of your untimely passing, ensuring their financial stability during difficult times.","Recognizes the importance of mental health by covering psychiatric treatment and therapy sessions, acknowledging mental wellness as a vital part of overall health.","Provides coverage for alternative treatments such as Ayurveda, Yoga, Unani, Siddha, and Homeopathy (AYUSH), catering to those who prefer non-allopathic treatment methods.","Enjoy the simplicity of fixed premium payments throughout the term of the policy, making it easier to plan your finances without worrying about increasing costs.","Choose from a variety of term lengths to match your coverage needs, whether you are looking for a short-term solution or long-term security."}', 650.00);
INSERT INTO insurehub.product (product_id, product_name, description, admin_id, coverage_desc, rate_amount) VALUES ('5EBE6DEC-A326-4290-5A67-1149FA9D4151', 'PetCare Insurance', 'Health and accident insurance for your pets, covering veterinary visits, surgeries, and emergency treatments.', '351BE228-665D-7C1E-F635-241DC4678153', '{"Policy covers a broad spectrum of veterinary care, including routine check-ups, diagnostic tests, emergency care, hospitalization, surgeries, and treatments for illnesses and injuries.","Immediate coverage for a variety of accidents, from minor mishaps to major traumas, ensuring your pet can receive prompt, life-saving treatments without delay.","Protection against the costs of treating serious illnesses such as diabetes, cancer, and hereditary conditions, ensuring long-term health management.","Offers coverage for unexpected emergency treatments that are necessary due to sudden illnesses or accidents, including visits to emergency clinics and specialists.","Policy includes care for chronic conditions that require ongoing treatment, providing peace of mind for pet owners facing long-term veterinary care."}', 1000.00);
INSERT INTO insurehub.product (product_id, product_name, description, admin_id, coverage_desc, rate_amount) VALUES ('CAD43C18-2146-734D-8BB5-2EB6560CEE85', 'Youth Assurance Shield', 'Designed for young adults, this plan offers life insurance coverage with options for education and early career benefits', '0DAF5D9B-1B77-81AD-8E04-7998A58D9015', '{"Option to add a critical illness rider that offers a lump sum payout upon the diagnosis of certain life-threatening illnesses, providing financial support when its needed most.","Tailor your coverage amount to fit your financial obligations and ensure that your loved ones are not burdened by debts or living expenses.","Benefit from an easy and straightforward application process with minimal paperwork, getting you the coverage you need without delay.","Some policies may offer the option to convert your term life insurance to a whole life or universal life policy, providing lifelong coverage without the need for a medical exam.","Increase your coverage with an accidental death benefit rider that provides additional compensation in the event of death due to an accident."}', 1500.00);
INSERT INTO insurehub.product (product_id, product_name, description, admin_id, coverage_desc, rate_amount) VALUES ('EDAC8B81-5E35-DBCF-E39D-0234ACB9A9F8', 'Future Invest Plan', 'An investment-linked insurance plan that combines the benefits of life cover with the potential of high returns', 'A854447C-B3B3-869B-ACA7-63E0D211B067', '{"The policy offers lifelong renewability, ensuring that you remain covered without interruption as you age, subject to policy terms and conditions.","Provides a daily cash allowance benefit for each day of hospitalization, which can be used to cover incidental expenses such as travel, food, or the needs of accompanying family members.","Includes cover for ambulance charges for emergency hospital transfers, reducing the burden of transportation costs during critical times.","Extends coverage to include maternity-related hospitalization and newborn baby care, safeguarding against the high costs associated with childbirth.","Offers complimentary annual health check-ups for policyholders, promoting preventive health care and early diagnosis of potential health issues."}', 950.00);
INSERT INTO insurehub.product (product_id, product_name, description, admin_id, coverage_desc, rate_amount) VALUES ('79C48462-D735-D51F-73DE-45D6AEE1114D', 'TravelEase Global Cover', 'International travel insurance providing emergency medical coverage, trip cancellation, and baggage loss protection', '69A6CDA3-41D3-B43C-5E10-6EBC4B444536', '{"The policy provides comprehensive medical coverage for illnesses or injuries that occur abroad, ensuring access to quality healthcare anywhere in the world.","Offers services for medical evacuation to the nearest adequate medical facility or repatriation to a hospital in the policyholders home country if necessary.","Reimburses non-refundable expenses if the trip is canceled due to unforeseen events such as sickness, a death in the family, or severe weather.","Compensates for the loss, theft, or damage of luggage and personal items, as well as expenses incurred due to baggage delays.","Provides around-the-clock travel assistance services, including help with lost passports, legal referrals, and translation services."}', 650.00);
